import React from 'react';
import ReactDOM from 'react-dom';
import Header from './header';

const App = () => {
    return (
        <div>
            <Header className="header"/>
        </div>
    )
}

const appElement = document.getElementById('app');

ReactDOM.render(<App />, appElement);
